        for j=d+nb:-1:2
            uk(j)=uk(j-1);
        end
        uk(1)=u(k);
        
        error(k)=yr-y(k);
        xc(1)=error(k)-error_1;
        xc(2)=error(k)-2*error_1+error_2;
        xc(3)=error(k);
        error_2=error_1;
        error_1=error(k);
    end
